import React from 'react';
import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonButton, IonLabel, IonIcon, IonList, IonItem } from '@ionic/react';
import { settingsOutline, personCircleOutline } from 'ionicons/icons';
import ExploreContainer from '../components/ExploreContainer';
import './Home.css';

const Home: React.FC = () => {
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar className="ion-no-shadow">
        <IonButton routerLink="/profile" fill="clear" size="large" color="light">    
          <IonIcon icon={personCircleOutline} />      
        </IonButton>
        <IonButton routerLink="/settings" fill="clear" size="large" color="light">    
          <IonIcon icon={settingsOutline} />
        </IonButton>
        </IonToolbar>
      </IonHeader>
      <IonContent>

      </IonContent>
    </IonPage>
  );
};

export default Home;
